def lis(permutation: tuple):
    """
    Patience sorting; By card deck analogy.

    This algorithm is proven to result in an amount of subsets that is equal to LIS length;
    Picking an element of each set thus yields a LIS.

    Inspired by: https://web.mit.edu/18.338/www/2012s/handouts/LIS.pdf
    """
    deck = permutation

    # Sorting deck into piles
    piles = []
    for card in deck:
        if card == deck[0]:  # First card starts first pile
            piles.append([card])
            continue
        placed = False
        for pile in piles:  # Check piles from left to right
            if card < pile[-1]:  # If card smaller than top card, add to pile
                pile.append(card)
                placed = True
                break
        if not placed:  # If card was not placed in other piles, start new pile
            piles.append([card])

    # Amount of piles = length of LIS.
    # To create a LIS, we take one card from each pile; the largest possible
    # Assembling LIS pile from piles
    LIS_pile = []
    for pile in piles[::-1]:  # Start from right piles
        for card in pile:  # Start with the bottom (largest) cards of the pile
            if card == piles[-1][0]:  # If the first pile, start with this card
                LIS_pile.append(card)
                break  # Only one card from each pile
            if card < LIS_pile[-1]:  # If smaller than current top LIS, then add card to LIS pile
                LIS_pile.append(card)
                break  # Only one card from each pile

    # LIS pile has the smallest card on top, which is the last element of the list. We want a tuple of reversed order.
    LIS = tuple(reversed(LIS_pile))

    return LIS




def lds(permutation: tuple):
    # Making large numbers small and small numbers large in permutation; Reversing order
    reverse_permutation = tuple(max(permutation)-n+1 for n in permutation)

    # We find LIS of the reverse ordered permutation
    reverse_LIS = lis(reverse_permutation)

    # Reverting numbers and thus order, making the LIS into the LDS
    LDS = [max(permutation)-n+1 for n in reverse_LIS]

    return LDS


